function HighScores({ scores }) {
  console.log(scores);

  // console.log(scores[0]?.score);
  // console.log({ scores });
  return (
    <div id="scoreBoard">
      <h3>HIGH SCORES</h3>
      <ol>
        {scores.map((item, index) => (
          <li key={index}>
            <p>{item.nickname}</p>
            <p>{item.score}</p>
          </li>
        ))}
      </ol>
    </div>
  );
}

export default HighScores;
